import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let name = "Aashish";

const imageLink1 = "https://picsum.photos/250/250";
const imageLink2 = "https://picsum.photos/250/251";
const imageLink3 = "https://picsum.photos/250/249";



ReactDOM.render(
  <>
    <h2 className='header'>My name is {name}. </h2>

    <img src = {imageLink1} alt = "Random Image from google"/>
    <img src = {imageLink2} alt = "Random Image from google"/>
    <img src = {imageLink3} alt = "Random Image from google"/>
  </>,
  document.getElementById('root')
);
